// In App.js in a new project

import * as React from 'react';
import { View, Text, Button, StyleSheet, KeyboardAvoidingView, Platform, TextInput } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const HomeScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <Text>Home</Text>
      <Button 
      title="Personal To-Do" 
      onPress={()=> navigation.navigate('Personal')}
      />
      <Button 
      title="Work To-Do" 
      onPress={()=> navigation.navigate('Work')}
      />
      <Button 
      title="School To-Do" 
      onPress={()=> navigation.navigate('School')}
      />
      <Button 
      title="Groceries List" 
      onPress={()=> navigation.navigate('Groceries')}
      />
    </View>
  );
}

const PersonalScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
    <Text>Personal taks</Text>
    <View style={styles.items}>
      <Task text={'Task 1'} />
      <Task text={'Task 1'} />
    </View>
    <KeyboardAvoidingView
      behavior={Platform.ios === "ios" ? "padding" : "height"}
      style={styles.writeTaskWrapper}
      >
        <TextInput style={styles.input} placeholder={"Write a new task"} />


      </KeyboardAvoidingView>

    <Button
      title="Back"
      onPress={() => navigation.goBack()}
      >
      </Button>
  </View>
  )
};

const WorkScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
    <Text> Work tasssks </Text>
    <Button
      title="Back"
      onPress={() => navigation.goBack()}
      >
      </Button>
  </View>
  )
};

const SchoolScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
    <Text>School taks</Text>
    <Button
      title="Back"
      onPress={() => navigation.goBack()}
      >
      </Button>
  </View>
  )
};

const GroceriesScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
    <Text>Groceries taks</Text>
    <Button
      title="Back"
      onPress={() => navigation.goBack()}
      >
      </Button>
  </View>
  )
};

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator 
        initialRouteName={"Home"}
        screenOptions = {{ 
          headerTitleAlign: "center",
          headerTintColor: 'grey',
          headerStyle: {
           backgroundColor: 'lightblue', 
          },
          headerRight: () => <Button title='Edit'
          />
        }}
        >
        <Stack.Screen
          name="Personal" 
          component={PersonalScreen} 
          options= {{  
            title:'Personal',
          }}
          />
        <Stack.Screen 
          name="Home" 
          component={HomeScreen}
          options= {{  
            title:'Welcome, to your Tasks.',
          }}
         />
        <Stack.Screen 
          name="Work" 
          component={WorkScreen} 
          options= {{  
            title:'Work',
          }}
          />
      <Stack.Screen 
        name="School" 
        component={SchoolScreen} 
        options= {{  
          title:'School',
        }}
        />
      <Stack.Screen 
        name="Groceries" 
        component={GroceriesScreen} 
        options= {{  
          title:'Groceries',
        }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}


const styles = StyleSheet.create ({
  container: { 
    flex: 1, 
    alignItems: 'center', 
    justifyContent: 'center' 
}
});

export default App;
